import './App.css';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
import landing from './components/landing/landing';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
<Switch>
<Route path="/" component={landing}></Route>
</Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
